import React from 'react'
import { Container } from 'react-bootstrap'
import {AuthUserCtx} from '../../context/authUser';

export const Me = () => {

    const {authUser} = useContext(AuthUserCtx);
    return (
        <Container>
            <div>Configuration for {authUser.username}</div>
        </Container>
    )
}
